B.XA=new A.ae("Es basiert auf dem Prinzip, dass Menschen h\xe4ufiger zu einem Spiel zur\xfcckkehren, wenn sie unvorhersehbare Belohnungen erhalten. Jedes Mal, wenn man das Rad dreht, k\xf6nnte man eine kleine oder gro\xdfe Belohnung bekommen \u2013 oder manchmal gar nichts. Das macht das Ganze besonders spannend, weil man nie wei\xdf, was als N\xe4chstes kommt.\n Hast du bemerkt, dass du \xf6fter das Spiel \xf6ffnest, nur um das Gl\xfccksrad zu drehen? F\xfchlst du dich motiviert, es immer wieder zu versuchen, in der Hoffnung, eine gr\xf6\xdfere Belohnung zu bekommen? Genau das ist die Absicht der Spieleentwickler: Sie wollen, dass du l\xe4nger im Spiel bleibst und vielleicht sogar echtes Geld ausgibst, um weitere Chancen auf Belohnungen zu bekommen.",null,null,null,null,null,null,null,null)
B.XB=new A.ae("Die Sammlungen sind so gestaltet, dass du das Bed\xfcrfnis versp\xfcrst, jedes einzelne Item zu erwerben, um die vollst\xe4ndige Belohnung zu erhalten. Oft fehlt dir am Ende nur noch ein kleines Teil, und das Spiel bietet dir gezielt die M\xf6glichkeit, dieses fehlende Item entweder durch stundenlanges Spielen oder gegen echtes Geld zu bekommen. Hast du bemerkt, wie zufriedenstellend es ist, eine Sammlung abzuschlie\xdfen? Oder dass du immer wieder spielst oder sogar Geld ausgibst, nur um das letzte Teil zu erhalten? Das ist genau so beabsichtigt: Spieleentwickler wollen, dass du dich motiviert f\xfchlst, diese letzte L\xfccke zu f\xfcllen, indem du mehr Zeit im Spiel verbringst oder Geld investierst, um das Gef\xfchl der Vollst\xe4ndigkeit zu erreichen.",null,null,null,null,null,null,null,null)
B.Ak=new A.ae("Im Hauptmen\xfc siehst du welche Level du bereits freigespielt hast (K\xe4stchen hat eine deckende Farbe (1)). In den oberen K\xe4stchen siehst du einerseits deine aktuelle Anzahl an M\xfcnzen (2) (diese kannst du nutzen um Sonderjellies zu kaufen) und, wie viele XP du hast (3) (diese bestimmen deine Position im Ranking der Highscore-Tafel (4). Die Highscore-Tafel (4) zeigt dir an, wie gut du dich im Vergleich zu anderen Spielern schl\xe4gst. Im Men\xfc (5) kannst du diese Instruktionen jederzeit erneut durchlesen, solltest du etwas vergessen haben. \n                                ",null,null,null,null,null,null,null,null)
B.XD=new A.ae("Oft werden solche Nachrichten genutzt, um Druck aufzubauen \u2013 vielleicht wurde dir ein zeitlich begrenzter Bonus versprochen oder Extra-Punkte, wenn du sofort spielst. Diese Benachrichtigungen sollen dich daran erinnern, das Spiel zu \xf6ffnen, auch wenn du gar nicht daran gedacht hast. Entwickler setzen darauf, dass du durch den Hinweis neugierig wirst und nicht widerstehen kannst, es gleich auszuprobieren.",null,null,null,null,null,null,null,null)
